import {Link} from 'react-router-dom';
import React, {Component} from 'react';
import Axios from 'axios';

class Home extends Component {
    constructor() {
        super();
        this.state= {
            movementsList:[],
            balance: '',
        }
    }

    componentDidMount() {
        //get list
        fetch('/movements/api/list/')
        .then(res => res.json())
        .then(data => {
          console.log(data);
          this.setState({
            movementsList:data
          })
        })
        .catch(console.log)

        //get balance
        Axios.get('/movements/api/balance/').then((response)=>{
            this.setState({
                balance: response.data.balance })
        })
    }

    render() {
        return (
        <div id="wrapper">

            {/* Sidebar */}
            <div class="sidebar-container">
            <div class="sidebar-logo">Mis finanzas</div>
                <ul class="sidebar-navigation">
                    <li class="header">Navigation</li>
                    <li>
                        <a href="#">
                            <i class="fa fa-home" aria-hidden="true"></i> Homepage
                        </a>
                    </li>
                    <li>
                        <a href="#">
                            <i class="fa fa-tachometer" aria-hidden="true"></i> Dashboard
                        </a>
                    </li>
                </ul>
            </div>

            <div class="content-container">
            <div class="container-fluid">
                {/* Main component for a primary marketing message or call to action*/}
                <div class="jumbotron">
                    <h1>Navbar example</h1>
                    <p>This example is a quick exercise to illustrate how the default, static and fixed to top navbar work. It includes the responsive CSS and HTML, so it also adapts to your viewport and device.</p>
                    <p>To see the difference between static and fixed top navbars, just scroll.</p>
                    <p>
                        <a class="btn btn-lg btn-primary" href="../../components/#navbar" role="button">View navbar docs &raquo;</a>
                    </p>
                </div>
            </div>
            </div>
            
            {/* Page Content */}
            <div className="content">
                                {/* Balance */}
                                <div class="container-fluid" class="div_balance">
                                    <h2>Balance:</h2>
                                    <h2>{this.state.balance}</h2>
                                </div>

                                {/* Last 10 movements */}
                                <div clasName = "tablediv">
                                    <h2>Ultimos movimientos:</h2>
                                        <div className="row justify-content-center">     
                                        <div className="col-8">
                                            <table className="table table-borderless table table-hover">
                                                <thead>
                                                    <tr>
                                                        <th scope="col">Fecha</th>
                                                        <th scope="col">Concepto</th>
                                                        <th scope="col"></th>
                                                        <th scope="col">Valor</th>
                                                        <th scope="col">Tipo</th>
                                                        <th scope="col">Tipo de gasto:</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                {this.state.movementsList.map((aMovement) => (
                                                <tr>  
                                                        <td>
                                                            {aMovement.input_date.split("T")[0].split('-').reverse().join('/')}
                                                        </td>
                                                        <td>
                                                            {aMovement.concept}
                                                        </td>
                                                        <td>
                                                            {aMovement.input_type=="Expense"?"-":"+"}
                                                        </td>
                                                        <td>
                                                            {aMovement.amount}
                                                        </td>
                                                        <td>
                                                            {aMovement.input_type=="Income"?"Ingreso":"Gasto"}
                                                        </td>
                                                        <td>
                                                            {aMovement.type_expense}
                                                        </td>
                                                </tr>
                                                        )
                                                    )
                                                }
                                                </tbody>
                                                </table>
                                        </div>
                                        </div>
                                </div>
            </div>

{/* Cierre de la funcion */}
        </div>)
}}

export default Home
